import React from 'react';

export const AddTech = () => {
    tech = [
        {
            firstName: 'John',
            lastName: 'Doe'
        },
        { firstName: 'John', lastName: 'Paulo' }
    ];
    return <div>tech</div>;
};

export default AddTech;
